<!DOCTYPE html>
<html>
<head>
    <style>
        html, body {
            height: 100%;
            margin: 0;
            padding: 0;
            width: 100%;
        }
        #graphiql {
            height: 100vh;
        }
        .header{
            background-color: #FEFEFE;
            padding: 15px;
            width: 100%;
            border-bottom: 1px solid #CCC;
        }
        .contextInput{
            float: right;
            font-size: 17px;
            margin-right: 30px;
            width: 250px;
            padding: 10px;
        }
        .reloadButton{
            float: right;
            font-size: 17px;
            margin-right: 30px;
            padding: 10px;
            height: 43px;
        }
        #logo{
            height: 40px;
        }

        .card > h1 {
            font-size: 12pt;
            font-family: Roboto;
            font-weight: 300;
        }
    </style>
    <!--
      This GraphiQL example depends on Promise and fetch, which are available in
      modern browsers, but can be "polyfilled" for older browsers.
      GraphiQL itself depends on React DOM.
      If you do not want to rely on a CDN, you can host these files locally or
      include them directly in your favored resource bunder.
    -->
    <script src="//cdn.jsdelivr.net/es6-promise/4.0.5/es6-promise.auto.min.js"></script>
    <script src="//cdn.jsdelivr.net/fetch/0.9.0/fetch.min.js"></script>
    <script src="//cdn.jsdelivr.net/react/15.4.2/react.min.js"></script>
    <script src="//cdn.jsdelivr.net/react/15.4.2/react-dom.min.js"></script>

    <!--
      These two files can be found in the npm module, however you may wish to
      copy them directly into your environment, or perhaps include them in your
      favored resource bundler.
     -->
    <link rel="stylesheet" href="//cdn.jsdelivr.net/npm/graphiql@0.12.0/graphiql.css">
    <script src="//cdn.jsdelivr.net/npm/graphiql@0.12.0/graphiql.min.js"></script>

</head>
</head>
<body>

<div class="header">
    <img id="logo" src="data:image/png;base64," />
    <input id="appKey" class="contextInput" type="text" placeholder="JWToken" />

    <input id="schema" class="contextInput" type="text" placeholder="Schema" onchange="renderGraphiQL()" />

    <button class="reloadButton" onclick="resetFormData(); renderGraphiQL();">Reload</button>

    <div style="display: block;">
        <button id="upload" style="background-color: #c51f1a; color: #FFF; padding: 10px; border: 0px; width: 200px; cursor: pointer;'">Upload file</button>
        <input type="file" id="inputFile" style="display: none;" />
    </div>
</div>



<div id="graphiql">Loading...</div>
<script>
    /**
     * This GraphiQL example illustrates how to use some of GraphiQL's props
     * in order to enable reading and updating the URL parameters, making
     * link sharing of queries a little bit easier.
     *
     * This is only one example of this kind of feature, GraphiQL exposes
     * various React params to enable interesting integrations.
     */
    var headers = {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
    }

    var formData = null;

    var inputFile = document.getElementById('inputFile');

    inputFile.addEventListener('change', function () {

        var fieldName = prompt('informe o nome do campo', 'file');

        inputFile.style.display = "block";
        inputFile.name = fieldName;
        inputFile.disabled = true;

        if(formData === null)
            formData = new FormData();

        formData.append(fieldName, inputFile.files[0], inputFile.files[0].name);
    });

    function resetFormData(){
        formData = null;

        inputFile.style.display = "none";
        inputFile.name = '';
        inputFile.disabled = false;
        inputFile.value = '';
    }

    document.getElementById('upload').addEventListener('click', function () {
        inputFile.click();
    });

    // Parse the search string to get url parameters.
    var search = window.location.search;
    var parameters = {};
    search.substr(1).split('&').forEach(function (entry) {
        var eq = entry.indexOf('=');
        if (eq >= 0) {
            parameters[decodeURIComponent(entry.slice(0, eq))] =
                decodeURIComponent(entry.slice(eq + 1));
        }
    });

    // if variables was provided, try to format it.
    if (parameters.variables) {
        try {
            parameters.variables =
                JSON.stringify(JSON.parse(parameters.variables), null, 2);
        } catch (e) {
            // Do nothing, we want to display the invalid JSON as a string, rather
            // than present an error.
        }
    }

    // When the query and variables string is edited, update the URL bar so
    // that it can be easily shared
    function onEditQuery(newQuery) {
        parameters.query = newQuery;
        // updateURL();
    }

    function onEditVariables(newVariables) {
        parameters.variables = newVariables;
        // updateURL();
    }

    function onEditOperationName(newOperationName) {
        parameters.operationName = newOperationName;
        // updateURL();
    }

    function getHeaders(){

        var appKey = document.getElementById('appKey').value;

        if(appKey !== '')
            headers['Authorization'] = 'Bearer ' + appKey;

        return headers;
    }

    function renderGraphiQL(){

        ReactDOM.render(
            React.createElement(GraphiQL, {
                fetcher: function (graphQLParams) {

                    var headers = getHeaders();

                    var body = JSON.stringify(graphQLParams);

                    if(formData !== null) {
                        formData.append('query', graphQLParams.query);
                        body = formData;

                        delete headers['Content-Type'];
                    }

                    var url = '/graphql';

                    var schema = document.getElementById('schema').value;;

                    if(schema)
                        url += '?schema=' + schema

                    return fetch(url, {
                        method: 'post',
                        headers: headers,
                        body: body,
                        credentials: 'include',
                    }).then(function (response) {
                        return response.text();
                    }).then(function (responseBody) {
                        try {
                            return JSON.parse(responseBody);
                        } catch (error) {
                            return responseBody;
                        }
                    })
                },
                query: parameters.query,
                variables: parameters.variables,
                operationName: parameters.operationName,
                onEditQuery: onEditQuery,
                onEditVariables: onEditVariables,
                onEditOperationName: onEditOperationName
            }),
            document.getElementById('graphiql')
        );
    }

    renderGraphiQL();

</script>
</body>
</html>